import React from "react";
import {Link} from 'react-router-dom'




const Header = ()=>{
    return(<>
    <navbar>
        <Link to="./"/>
        <Link to="./contact"/>
        <Link to="./about"/>
        <Link to="./services"/>
    </navbar>
     
    </>)
}


export default Header;
